webpackJsonp([27],{780:function(r,n){r.exports="### Subclassable Built-ins\r\n\r\n#### Description\r\nBuilt-in objects now can be subclassed, like `Array`, `Date`, `Object`.\r\n\r\n\r\n#### Examples\r\n```javascript\r\nclass MyArray extends Array {\r\n    constructor(...args) {\r\n      super(...args);\r\n    }\r\n\r\n    // Adding new methods to my custom Array constructor\r\n    isEmpty() {\r\n      return this.length === 0\r\n    }\r\n}\r\n\r\nlet arr = new MyArray();\r\n\r\narr.isEmpty() // => true\r\n```\r\n"}});